MOONEYES<b>エンケイ/ムーンアイズ 5 Spoke Wheel 14×6＜5穴/4.5（114.3）/+10＞</b><BR>オールド ドメスティックカー ファンの方々、長らくお待たせしました！ENKEI と MOONEYESのコラボレーションが遂に実現！<BR>輸出用センタースポークをイメージして、ショット(梨地)は粗く、スポークのエッジもより鋭角にしたことで、国内仕様よりスポーティーなイメージになっています。また、リムの引き目を残した事で、ただのポリッシュには無いギラギラと鈍く光るような仕上げとしました。裏側は Y-30、130 クラウンにもマッチするようなセンターボア、キャリパー クリアランスを確保。エンケイ オリジナルのセンター キャップは外からネジ止めで、当時のエンブレムの復刻です。＊1本の価格です<BR><font color=red>＊取り付けには下記の専用ナット＆ワッシャーが必要です（別売り・1ホイールにつき各5個必要です）</font><BR><BR>【取り付けナット】<BR>TOYOTA（トヨタ）＜12mm×1.5インチ＞・NISSAN（日産）＜12mm×1.25インチ＞・FORD＆MOPAR＜1/2インチ＞<BR><BR>【ワッシャー】<BR>アルミ ナット ワッシャー<style type="text/css">
